keys(对象自身属性的键集合)
{k: v} → [k]
R.keys({a: 1, b: 2, c: 3}); //=> ['a', 'b', 'c']

keysIn(对象自身和继承属性的键集合)
{k: v} → [k]
var F = function() { this.x = 'X'; };
F.prototype.y = 'Y';
var f = new F();
R.keysIn(f); //=> ['x', 'y']

values(对象自身属性值集合)
{k: v} → [v]
R.values({a: 1, b: 2, c: 3}); //=> [1, 2, 3]

valuesIn(对象自身和继承属性的值集合)
{k: v} → [v]
var F = function() { this.x = 'X'; };
F.prototype.y = 'Y';
var f = new F();
R.valuesIn(f); //=> ['X', 'Y']

assoc(添加或重写指定属性)
String → a → {k: v} → {k: v}
//第一个参数prop属性名
//第二个参数val属性值
//第三个参数target对象
//得到一个新的对象，原对象不变
R.assoc('c', 3, {a: 1, b: 2}); //=> {a: 1, b: 2, c: 3}

assocPath(添加或重写指定路径的值)
[Idx] → a → {a} → {a} Idx = String | Int
//第一个参数path路径
//第二个参数val属性值
//第三个参数target对象
//得到一个新的对象，原对象不变
R.assocPath(['a', 'b', 'c'], 42, {a: {b: {c: 0}}}); //=> {a: {b: {c: 42}}}

// Any missing or non-object keys in path will be overridden
R.assocPath(['a', 'b', 'c'], 42, {a: 5}); //=> {a: {b: {c: 42}}}

clone(深层克隆)
{*} → {*}
var objects = [{}, {}, {}];
var objectsClone = R.clone(objects);
objects === objectsClone; //=> false
objects[0] === objectsClone[0]; //=> false

dissoc(删除指定属性)
String → {k: v} → {k: v}
//第一个参数prop属性名
//第三个参数target对象
//得到一个新的对象，原对象不变
R.dissoc('b', {a: 1, b: 2, c: 3}); //=> {a: 1, c: 3}

dissocPath(删除指定路径的属性)
[Idx] → {k: v} → {k: v} Idx = String | Int
//第一个参数path路径
//第三个参数target对象
//得到一个新的对象，原对象不变
R.dissocPath(['a', 'b', 'c'], {a: {b: {c: 42}}}); //=> {a: {b: {}}}

eqProps(属性值是否相等)
k → {k: v} → {k: v} → Boolean
var o1 = { a: 1, b: 2, c: 3, d: 4 };
var o2 = { a: 10, b: 20, c: 3, d: 40 };
R.eqProps('a', o1, o2); //=> false
R.eqProps('c', o1, o2); //=> true

evolve(自定义对象转换)
{k: (v → v)} → {k: v} → {k: v}
//第一个参数transformations转换规则
//第三个参数target对象
//得到一个新的对象，原对象不变
var tomato  = {firstName: '  Tomato ', data: {elapsed: 100, remaining: 1400}, id:123};
var transformations = {
  firstName: R.trim,
  lastName: R.trim, // Will not get invoked.
  data: {elapsed: R.add(1), remaining: R.add(-1)}
};
R.evolve(transformations, tomato); //=> {firstName: 'Tomato', data: {elapsed: 101, remaining: 1399}, id:123}

forEachObjIndexed(遍历对象)
((a, String, StrMap a) → Any) → StrMap a → StrMap a
//第一个参数fn,接受三个参数value,key,obj
//第三个参数obj对象
//返回原对象
var printKeyConcatValue = (value, key) => console.log(key + ':' + value);
R.forEachObjIndexed(printKeyConcatValue, {x: 1, y: 2}); //=> {x: 1, y: 2}
// x:1
// y:2

mapObjIndexed(遍历对象)
((*, String, Object) → *) → Object → Object
//返回新对象
var values = { x: 1, y: 2, z: 3 };
